// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awPageRenderFunction } from 'js/AwPageService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwPageService', () => import('js/AwPageService'));
registerDynImportEntry('js/aw.narrowMode.service', () => import('js/aw.narrowMode.service'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "awPageRenderFunction",
            "deps": "js/AwPageService"
        },
        "initialize": {
            "actionType": "batchJob",
            "steps": [
                {
                    "action": "cleanCdmCache"
                },
                {
                    "action": "setBrowsertitle"
                },
                {
                    "action": "checkNarrowMode"
                }
            ]
        },
        "cleanCdmCache": {
            "actionType": "Event",
            "method": "Event",
            "inputData": {
                "events": [
                    {
                        "name": "cdm.cleanCache",
                        "eventData": {}
                    }
                ]
            }
        },
        "setBrowsertitle": {
            "actionType": "JSFunctionAsync",
            "method": "getBrowserTitle",
            "outputData": {
                "browserTitle": ""
            },
            "deps": "js/AwPageService"
        },
        "checkNarrowMode": {
            "actionType": "JSFunction",
            "method": "checkNarrowMode",
            "deps": "js/aw.narrowMode.service"
        },
        "setOnNarrowModeTitle": {
            "actionType": "JSFunction",
            "method": "setOnNarrowModeTitle",
            "inputData": {
                "data": "{{data}}"
            },
            "deps": "js/AwPageService"
        },
        "handleNarrowModeChange": {
            "actionType": "JSFunction",
            "method": "handleNarrowModeChange",
            "inputData": {
                "eventdata": "{{parameters.eventData}}",
                "data": "{{data}}"
            },
            "deps": "js/AwPageService"
        },
        "onSublocationSelectionChange": {
            "actionType": "JSFunction",
            "method": "onSubLocationContentSelectionChange",
            "inputData": {
                "eventdata": "{{parameters.eventData}}",
                "data": "{{data}}"
            },
            "deps": "js/AwPageService"
        }
    },
    "data": {
        "layoutSummaryOnly": null
    },
    "conditions": {},
    "onEvent": [
        {
            "eventId": "aw.windowResize",
            "action": "checkNarrowMode"
        },
        {
            "eventId": "narrowModeChangeEvent",
            "action": "handleNarrowModeChange",
            "inputArgs": {
                "eventData": "{{eventData}}"
            }
        },
        {
            "eventId": "narrowSummaryLocationTitleClickEvent",
            "action": "setOnNarrowModeTitle"
        },
        {
            "eventId": "gwt.SubLocationContentSelectionChangeEvent",
            "action": "onSublocationSelectionChange",
            "inputArgs": {
                "eventData": "{{eventData}}"
            }
        }
    ],
    "props": {
        "browser-sub-title": {
            "type": "string"
        },
        "browser-title": {
            "type": "string"
        },
        "header-title": {
            "type": "string"
        },
        "location-panel-style": {
            "type": "string"
        },
        "sub-location-tabs": {
            "type": "object"
        }
    },
    "lifecycleHooks": {
        "onMount": "initialize",
        "render": "render"
    },
    "_viewModelId": "AwPage",
    "_uniqueViewModelId": "AwPage",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awPageRenderFunction, undefined, ctxImportObj );

